	b->yy_ch_buf = (char *) nft_alloc(b->yy_buf_size + 2 ,yyscanner );
	if ( ! b->yy_ch_buf )
		YY_FATAL_ERROR( "out of dynamic memory in nft__create_buffer()" );

	b->yy_is_our_buffer = 1;

	nft__init_buffer(b,file ,yyscanner);

	return b;
